  return (
    <header className="glass flex justify-between items-center mb-8">
      <h1 className="text-2xl font-semibold tracking-wide">Trend<span className="text-purple-400">AI</span></h1>
      <nav className="flex space-x-6">
        <a href="#" className="hover:text-purple-300">Home</a>
        <a href="#" className="hover:text-purple-300">Dashboard</a>
        <a href="#" className="hover:text-purple-300">About</a>
      </nav>
    </header>
  );
}
